import React from 'react';
import logoImg from "";

class Navbar extends React.Component {
render() {
    return (
        <nav id="navbar">
        <div className="nav_brand">
          <img src={logoImg} alt="" className="logo"/>
          <h1>Space Flight News</h1>
        </div>

        <ul className="nav_list">
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/">Trending</a>
          </li>
          <li>
            <a href="/">Categories</a>
          </li>
          <li>
            <a href="/">About us</a>
          </li>
        </ul>
      </nav>
    )
}
}

export default Navbar;
